 (above image)<br><p><br></p><p>Plese click forsale link to see pricing.</p><p><a href=\"darrelhelm32@gmail.com\">Darrelhelm32@gmail.com</a> to make an offer.&nbsp;<br></p><p><br></p><h2><span style=\"font-weight: normal;\">STARTALKER</span></h2><p><im src=\"img:-134239002:img\" alt=\"IMG_7909.jpeg\"></p><p><im src=\"img:761670482:img\" alt=\"IMG_7944.jpeg\"><im src=\"img:151268244:img\" alt=\"IMG_7992.jpeg\" style=\"font-size: 12pt;\"></p><p>Painted the MPC cheeks!</p><p><br></p><p><im src=\"img:-837214908:img\" alt=\"IMG_5728.jpeg\">&nbsp;<im src=\"img:-369164582:img\" alt=\"IMG_0106.jpeg\" style=\"font-size: 12pt;\">&nbsp;</p><p><b>Collabs with AGL 505 And Patching with Eli <br></b></p><p><br></p><p></p><p></p><p></p>","G":1693367639745,"H":"9i(q1hFhU","I":true},{"C":"f[pBVj]Gh","A":"ART WALKS","D":"about","E":1693184116829,"F":"<h2>Trash Gardens (2021-Current)</h2><div><br></div><div><b>My relationship with trash.</b><br></div><div><p>I am currently working with free, found, trash, items that are found on my walks.&nbsp;</p><p>This is a process that started when I was picking up trash around my neighborhood</p><p>&nbsp;in Cincinnati in 2021. Although the medium of trash etc. is not new it is a fun way&nbsp;</p><p>to enjoy the community and integrate it into my art experience. These pieces are <br></p><p>inspired by the natural beauty found on my walks and I try to appreciate how the litter <br></p><p>looks and acts to beautify parts of the city acting as temporary art works. <br></p><p><br></p><p align=\"right\"><b>Vision for the Community</b><br></p><p align=\"right\">Through this art, we realize Appreciating trash is key</p><p data-pm-slice=\"1 1 []\" align=\"right\"><span class=\"ai-text\">Appreciation plays a crucial role in this art form. By finding beauty in the discarded,&nbsp;</span></p><p data-pm-slice=\"1 1 []\" align=\"right\"><span class=\"ai-text\">trash artists encourage viewers to see the potential in the overlooked and underappreciated.</span></p><p data-pm-slice=\"1 1 []\" align=\"right\"><span class=\"ai-text\">&nbsp;It prompts us to reflect on our consumption habits and the impact they have on the environment.</span></p><p align=\"right\"><span data-comment-id=\"eee1c774-e0f2-4397-83da-6e0ff06bdca7\" data-updated-at=\"2023-08-28T01:18:10.391Z\" data-published=\"true\" data-user-id=\"-1\" class=\"comment\"><span data-comment-id=\"eee1c774-e0f2-4397-83da-6e0ff06bdca7\" data-updated-at=\"2023-08-28T01:19:05.431Z\" data-published=\"true\" data-user-id=\"229900\" class=\"comment\"><span class=\"ai-text\">Moreover, trash art serves as a reminder of our responsibility towards nature. It highlights&nbsp;</span></span></span></p><p align=\"right\"><span data-comment-id=\"eee1c774-e0f2-4397-83da-6e0ff06bdca7\" data-updated-at=\"2023-08-28T01:18:10.391Z\" data-published=\"true\" data-user-id=\"-1\" class=\"comment\"><span data-comment-id=\"eee1c774-e0f2-4397-83da-6e0ff06bdca7\" data-updated-at=\"2023-08-28T01:19:05.431Z\" data-published=\"true\" data-user-id=\"229900\" class=\"comment\"><span class=\"ai-text\">the consequences of our actions and urges us to reconsider our relationship with the planet. </span></span></span></p><p></p><p><br></p><p><im src=\"https://lh3.googleusercontent.com/pw/AIL4fc9GFTk59KKneNNfxD_I4INumuxRQeWsARFZKBCxwxnC_jnxRKhjJ6nnPfdLvLlRfu4Bj3E-sgGCafXTusl4d623LQVROtQWBKbtjltEVmnYmvMpe8I=w2400\"></p></div><p>(Cincinnati 2023.)<br></p>","G":1693192910977,"H":"9i(q1hFhU"},{"C":"}V}%<l?,.","A":"ABOUT","D":"about_1","E":1693184907122,"F":"<h2 align=\"left\"><b>THE MOONGARDEN</b></h2><p>The moon garden is a digital garden for sharing my personal art practice and additional community arts endeavors.</p><p><a href=\"mailto:mousepadbliss@gmail.com\"><b><i><u>mousepadbliss@gmail.com\n</u></i></b></a></p>","G":1693360515981},{"C":"k_$VrBed<","A":"POETRY GARDEN","D":"poetry_garden","E":1693191569263,"F":"<p><a href=\"https://drive.google.com/file/d/1XwePHe-PIE9S6P0vEERPD1ZrrU7TSO8b/view?usp=drivesdk\">T
